using QuestPDF.Fluent;
using QuestPDF.Helpers;
using QuestPDF.Infrastructure;

namespace Testing.Net6.Console.PDF.VivirSeguros;

public class CertificateDocument : IDocument
{
    public static Image logo = Image.FromStream(new MemoryStream(Convert.FromBase64String("")));

    public static Image vivir = Image.FromStream(new MemoryStream(Convert.FromBase64String("")));

    public void Compose(IDocumentContainer container)
    {

        container
            .Page(pg =>
            {
                pg.Margin(35);
                pg.DefaultTextStyle(x =>
                    x.FontColor(Colors.Blue.Darken4)
                );
                pg.Size(PageSizes.A4);
                pg.Header().AlignTop().Element(HeaderCertificate);
                pg.Content().AlignMiddle().Element(ContentCertificate);
                pg.Footer().AlignBottom().Element(FooterCertificate);
            });
    }

    void ContentCertificate(IContainer cnt)
    {
        cnt.Extend().Padding(2).Column(c =>
        {
            c.Item().Row(r =>
            {
                r.RelativeItem(50);
                r.RelativeItem(50);
            });

            c.Item().Element(TableCertificate);
        });
    }

    void TableCertificate(IContainer cnt)
    {
        cnt.Table(tbl =>
        {
            tbl.ColumnsDefinition(c =>
            {
                c.RelativeColumn(4);
                c.RelativeColumn(2);
                c.RelativeColumn(2);
            });

            tbl.Header(h =>
            {
                h.Cell().Element(StyleHeader).Text("COMPANIA DE SEGUROS");
                h.Cell().ColumnSpan(2).AlignCenter().Element(StyleHeader).Text("EN CASO DE EMERGENCIA");
            });

            tbl.Cell().Padding(1).Image(vivir).WithCompressionQuality(ImageCompressionQuality.High);

            tbl.Cell().ColumnSpan(2).PaddingTop(10).AlignCenter().Text("01 604 2000").FontSize(40).ExtraBold();

            tbl.Cell().ColumnSpan(3).Text(new string('\\',142));

            tbl.Cell().ColumnSpan(3).Element(StyleContent).Text("VIGENCIA DE POLIZA");

            tbl.Cell().Text("Nro Poliza Certificado");
            tbl.Cell().ColumnSpan(2).Text("CERTIFICADO SOAT");

            tbl.Cell().Text("S0000012");
            tbl.Cell().ColumnSpan(2).Text("CONTROL POLICIAL");

            tbl.Cell().Text("Desde1");
            tbl.Cell().ColumnSpan(1).Text("Desde2");
            tbl.Cell().ColumnSpan(1).RowSpan(4).BorderLeft(1).Padding(5).Text(x =>
            {
                x.Span("Vigencia de uso");
                x.EmptyLine();
                x.Span("exclusivo para");
                x.EmptyLine();
                x.Span("control policial");
            });

            tbl.Cell().PaddingBottom(10).Text("2023-01-01");
            tbl.Cell().ColumnSpan(1).PaddingBottom(10).Text("2023-01-01"); ;

            tbl.Cell().Text("Hasta3");
            tbl.Cell().ColumnSpan(1).Text("Hasta4");

            tbl.Cell().PaddingBottom(3).Text("2024-01-01");
            tbl.Cell().ColumnSpan(1).PaddingBottom(10).Text("2024-01-01");

            tbl.Cell().ColumnSpan(3).Height(10);

            tbl.Cell().ColumnSpan(3).BorderTop(1).PaddingTop(3).Element(StyleContent).Text("VEHICULO ASEGURADO");

            tbl.Cell().Text("Placa");
            tbl.Cell().ColumnSpan(2).Text("Nombres");

            tbl.Cell().PaddingBottom(10).Text("BEB656");
            tbl.Cell().ColumnSpan(2).PaddingBottom(10).Text("RENZO JARED LEON MELGAREJO");

            tbl.Cell().Text("Categoria / Clase");
            tbl.Cell().ColumnSpan(2).Text("Importe de la prima");

            tbl.Cell().PaddingBottom(10).Text("SUV");
            tbl.Cell().ColumnSpan(2).PaddingBottom(10).Text("s/ 120.00");

            tbl.Cell().Text("Uso");
            tbl.Cell().ColumnSpan(2).Text("Fecha");

            tbl.Cell().PaddingBottom(10).Text("PARTICULAR");
            tbl.Cell().ColumnSpan(2).PaddingBottom(10).Text("2023-01-01");

            tbl.Cell().Text("Vin nro Serie");
            tbl.Cell().ColumnSpan(2).Text("Hora de Emision");

            tbl.Cell().Text("1524278331");
            tbl.Cell().ColumnSpan(2).Text("16:42");
        });

        static IContainer StyleHeader(IContainer cnt)
        {
            var retrn = cnt.DefaultTextStyle(x => x.SemiBold()).PaddingVertical(5);
            return retrn;
        }

        static IContainer StyleContent(IContainer cnt)
        {
            var retrn = cnt.DefaultTextStyle(x => x.SemiBold()).PaddingVertical(5);
            return retrn;
        }
    }

    void HeaderCertificate(IContainer cnt)
    {
        var styleDefaultLetter = TextStyle.Default.FontSize(14).FontColor(Colors.Pink.Medium);

        cnt.BorderBottom(1).BorderColor(Colors.Pink.Darken4).Row(row =>
        {
            row.RelativeItem().AlignLeft().Column(c =>
            {
                c.Item().Width(200).Image(logo);
                c.Spacing(5);
                c.Item().PaddingLeft(5).PaddingTop(5).Text("Certificado Electronico").Style(styleDefaultLetter);
                c.Item().PaddingLeft(5).PaddingBottom(5).Text("Decreto Supremo Nro 015-2016-MTC").Style(styleDefaultLetter);
            });

            row.ConstantItem(250).AlignCenter().Column(c =>
            {
                c.Item().Padding(1);
                c.Item().Text("SOAT").FontSize(62).ExtraBold().FontColor(Colors.Pink.Darken2);
            });
        }); 
    }

    void FooterCertificate(IContainer cnt)
    {
        cnt.Row(x =>
        {
            x.RelativeItem().AlignCenter().DefaultTextStyle(TextStyle.Default.FontSize(12)).Column(s =>
            {
                s.Item().PaddingBottom(4).Text(t =>
                {
                    t.AlignCenter();
                    t.Span("Los establecimientos de salud públicos y privados están obligados a prestar atención medica quirúrgica de emergencia en caso de la ocurrencia de un accidente de tránsito conforme en la");
                    t.EmptyLine();
                    t.Span("ley N° 26842. Ley General de Salud y su Reglamento");
                });

                s.Item().Background(Colors.Blue.Darken4).Padding(8).Text(t =>
                {
                    t.AlignCenter();
                    t.Span("La información sobre las obligaciones y derechos del contratante/asegurado, cobertura y").FontColor(Colors.White);
                    t.EmptyLine();
                    t.Span("exclusiones, las podrás encontrar ingresando a www.apeseg.org.pe/soat o solicitando tu").FontColor(Colors.White);
                    t.EmptyLine();
                    t.Span("cartilla informativa en las oficinas de tu compañía de seguros o al enlace").FontColor(Colors.White);
                    t.EmptyLine();
                    t.Span("https://soat.vivirseguros.pe/soat").FontColor(Colors.White).Underline();
                });
            });
        });
    }
}
